import React, { useState } from "react";

function searchClick ()  {
    
    const [searchUpdate, setUpdate] = useState(false)

    const handleClick = e => {
        setUpdate(!searchUpdate)
    }

    return {searchUpdate, handleClick}
}

export default searchClick;
